import React from 'react';
import {Link} from 'react-router-dom'
const UserItems = ({user}) => {
    return ( 
        <div className="  col-lg-3 col-sm-6 ">
        <div class="card-deck ">
  <div class="card">
  
    <div class="card-body">
      <h5 class="card-title">user Id: {user._id}</h5>
      <h5 class="card-title">user NAMe: <br/> {user.name}</h5>
      <h5 class="card-title">email:{user.email}</h5>
      <h5 class="card-title">status:{user.isAdmin ? (<i className="fa fa-user"></i> ):(<i className="fa fa-times"></i>)}</h5>
      
     
      {user.isAdmin ?(<Link  className="btn btn-outline-info rounded-pill"> admin</Link>):(<Link  className="btn btn-outline-info rounded-pill">Make admin</Link>)}
      
      <Link  className="ml-2 btn btn-outline-danger rounded-pill">Delete</Link>
    </div>
    
  </div>
  
</div>
</div>
     );
}
 
export default UserItems
